import React, {memo} from 'react';
import styled from 'styled-components';

import mq from '../style/MediaQuery';

const HeaderContainer = styled.div`
    width:100%;
    height:120px;
    background-color: #fff;
    margin: 0 auto;

    .headerWrap{
        max-width: 1200px;
        height: 100%;
        margin:0 auto;
        display: flex;
        justify-content: space-between;
        align-items: center;
        background-color: #ff0;

        .logoWrap{
            width:120px;
        }

        .navWrap{
            background-color: #f0f5;
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding-left:100px;
            max-width: 962px;
            
            .navInner{
                display: flex;
            }
        }
    }
`;

const Header = memo(() => {
  return (
    <HeaderContainer>
      <div className='headerWrap'>
        <div className='logoWrap'>
            <a href='#'><img src='' alt='내일응원로고' /></a>
        </div>
        <div className='navWrap'>
            <ul className='navInner'>
                <li className='navItem'>
                    <a href='#' className='Mainlink'>취업지원</a>
                </li>
                <li className='navItem'>
                    <a href='#' className='Mainlink'>취업지원</a>
                </li>
                <li className='navItem'>
                    <a href='#' className='Mainlink'>취업지원</a>
                </li>
                <li className='navItem'>
                    <a href='#' className='Mainlink'>취업지원</a>
                </li>
                <li className='navItem'>
                    <a href='#' className='Mainlink'>취업지원</a>
                </li>
                <li className='navItem'>
                    <a href='#' className='Mainlink'>취업지원</a>
                </li>
            </ul>
        </div>
        <div className='subNavWrap'>
            <ul className='subNavWrap'>
                <li className='subNavItem'>
                    <a href='#' className='link'>회원가입</a>
                </li>
                <li className='subNavItem'>
                    <a href='#' className='link'>로그인</a>
                </li>
            </ul>
        </div>
        
      </div>
    </HeaderContainer>
  );
});

export default Header;
